import {
	Text,
	Flex,
	TableContainer,
	Tab,
	Table,
	Thead,
	Tr,
	Th,
	Tbody,
	Td,
} from '@chakra-ui/react';
import { useEffect, useState } from 'react';

export const App = () => {
	const [data, setData] = useState(null);

	const getData = () => {
		fetch('/data')
			.then((newData) => newData.json())
			.then((d) => {
				console.log(d.data);
				setData(d.data);
			});
	};
	useEffect(() => {
		getData();
	}, []);
	return (
		<Flex alignItems="center" justify="center" w="100vw" minHeight="100vh">
			<Text position="absolute" top="5vh" fontWeight="bold" fontSize="18">
				S&P 500 Index Data
			</Text>
			{data && <DataTable data={data} />}
		</Flex>
	);
};

const DataTable = ({ data }) => {
	let columns = ['Symbol'];
	columns = columns.concat(columns, Object.keys(data[0]));

	const renderRows = () => {
		return (
			<Tr>
				{columns.map((c, idx) => {
					return (
						<Td key={idx}>
							<Text>{data[c]}</Text>
						</Td>
					);
				})}
			</Tr>
		);
	};

	const renderHeader = () => {
		return columns.map((c, idx) => {
			return (
				<Th key={idx}>
					<Text fontSize={18} fontWeight="semibold">
						{c}
					</Text>
				</Th>
			);
		});
	};
	return (
		<TableContainer
			bg="white"
			borderWidth={2}
			borderColor="black"
			borderRadius={10}
			w="70vw"
			h="70vh"
		>
			<Table>
				<Thead>
					<Tr>{renderHeader()}</Tr>
				</Thead>

				<Tbody>{renderRows()}</Tbody>
			</Table>
		</TableContainer>
	);
};
